import React from 'react';
import { Container, Content, Background } from './style';
import logoImg from './../../assets/logo.svg';

const SignIn: React.FC = () => (
    <Container>
        <Content>
            <img src={logoImg} alt="Logo GoBarber" />
        </Content>

        <Background />
    </Container>
);


export default SignIn;
